import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
display : flex;
gap:24px;
`;
const Content = styled.div`
flex:5;
`
const VideoWrapper = styled.div`
flex:5;
`;

const Recommandation = styled.div`
flex:2
`;

const Video = () => {
  return (
    <Container>
      <Content>
        Content
        </Content>
        <Recommandation>
          Recommandation
        </Recommandation>
    </Container>
  )
}

export default Video
